import { BrowserRouter as Router , Route, Switch } from 'react-router-dom';
import './App.css';
import Home from './prueba';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/prueba" component = {Home}></Route>
      </Switch>
      <div className="App">
        <h1>Hola</h1>
      </div>
    );
    </Router>
  )
}

export default App;
